import React from "react";
import hello from "./hello.png";

const textStyle = {
  position: "relative",
  fontSize: "25vh",
  color: "#748281",
  top: "20vh",
  left: "5vw",
};

const LeftPanel = () => {
  return (
    <div>
      <div className="Login-text" style={textStyle}>
        LOGIN
      </div>
      <img className="Hello" src={hello} alt="" />
    </div>
  );
};

export default LeftPanel;
